// RoomDetailsPage.js

import React from 'react';

const RoomDetailsPage = () => {
  // Define room data
  const rooms = [
    { Type: 'Single Seater', Rentdescription: 'Description for single seater room.' },
    { type: 'Double Seater', description: 'Description for double seater room.' },
    { type: 'Three Seater', description: 'Description for three seater room.' },
    { type: 'Four Seater', description: 'Description for four seater room.' }
  ];

  return (
    <div className="container">
      <h2>Room Details</h2>
      <div className="row">
        {rooms.map((room, index) => (
          <div key={index} className="col-md-4 mb-4">
            <div className="card">
              <div className="card-body">
                <h5 className="card-title">{room.type}</h5>
                <p className="card-text">{room.description}</p>
              </div>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
};

export default RoomDetailsPage;
